// React
import React from "react";
import PropTypes from "prop-types";
import { Link } from "react-router-dom";

function CollectionsMenu(props) {
  const { menuItems } = props;

  return (
    <div id="menuContainer">
      <div id="menu">
        {menuItems.map((menuItem, index) => {
          console.log(menuItem);
          return (
            <Link
              className="menuOption clickable"
              to={menuItem.pageRoute}
              key={`menu-${menuItem.pageRoute}`}
            >
              <>
                <span className="menuOptionTitle">{menuItem["Title"]}</span>
                {menuItem["Title"] && (
                  <>
                    <br />
                    <span className="menuOptionSubtitle">
                      {menuItem["Title"]}
                    </span>
                  </>
                )}
              </>
            </Link>
          );
        })}
      </div>
    </div>
  );
}

CollectionsMenu.propTypes = {
  menuItems: PropTypes.array,
};

export default CollectionsMenu;
